import './App.css';
import {Routes, BrowserRouter as Router,Route} from "react-router-dom";
import {Home,Login,Register,About} from "./Home";
import Navbar from "./Navbar";
function App() {
  return (
    <div className="App">
      <Navbar/>
      <Router>
        <Routes>
          <Route to="/Home" element={<Home/>}/>
          <Route to="/Login" element={<Login/>}/>

        </Routes>
      </Router>
    </div>
  );
}

export default App;
